gqG(){return"Deto es desarrollado y concebido para usted, la aplicaci\xf3n debe ser una herramienta \xfatil para usted y ofrecerle una plataforma para la colecci\xf3n y publicaci\xf3n central de sus eventos motivados pol\xedticamente, por lo que cada uno de nosotros ahora tiene la oportunidad de planificar y publicar nuestros propios eventos, y, por lo tanto, sus eventos lo m\xe1s accesibles de manera central y f\xe1cil de ser presentada a una gran audiencia para ver.\n\nDeto se centra principalmente en eventos pol\xedticamente motivados democr\xe1ticamente, sin embargo, la aplicaci\xf3n tambi\xe9n le ofrece la oportunidad de crear y publicar eventos no pol\xedticos.\n\nPuede compartir sus eventos o depositar sus plataformas de transmisi\xf3n social / en vivo, o recibir una notificaci\xf3n sobre los pr\xf3ximos eventos y mucho m\xe1s ...\n\nEsperamos que pudi\xe9ramos contribuir una peque\xf1a parte al desarrollo democr\xe1tico con nuestra aplicaci\xf3n, y estamos muy contentos si usa nuestra aplicaci\xf3n y la recomienda si le gusta.\n\nSi tiene alguna pregunta, solicitud o sugerencia de mejora, puede usar el formulario de contacto en la pantalla Acerca de o simplemente ingresar nuestro grupo Telegram T.Me./Deto-App_Group o visitar el canal T.ME/DETO_APP_CHANNEL/. y suscribirse.\n\nLe deseamos todo el \xe9xito en la creaci\xf3n y alojamiento de sus eventos, esperamos que se divierta mucho con su aplicaci\xf3n DETO.\n\nNota: Seleccione su opci\xf3n de lenguaje y tema preferido, para continuar, debe confirmar la casilla de verificaci\xf3n en la parte inferior\n\nTu equipo de DETO"},
